package Strings;

public class StringEquals {

	public static void main(String[] args) 
	{
		// TODO Auto-generated method stub
		String s="String1";
		String s1="String1";
		
		if(s==s1)
		{
		System.out.println("s and s1 are equal");	
		}
		else System.out.println("s and s1 are not equal");
		if(s.equals(s1))
		{
			
			System.out.println("s and s1 are equal");	
		}
		else System.out.println("s and s1 are not equal");
		
	}

}
